'use strict';

var valid = [];
var test;

test = {
	'code': [
		'var betainc = require( \'./betainc.js\' );',
		'',
		'module.exports = betainc;'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'var foo = \'bar\';',
		'',
		'module.exports = foo;'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'var randn = require( \'./randn.js\' );',
		'var factory = require( \'./factory.js\' );',
		'',
		'randn.factory = factory;',
		'',
		'module.exports = randn;'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'var factory = require( \'./factory.js\' );',
		'',
		'var rand = factory();',
		'',
		'module.exports = rand;'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'module.exports = Object.create;'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'module.exports = 6;'
	].join( '\n' )
};
valid.push( test );

test = {
	'code': [
		'module.exports = \'Helo World\';'
	].join( '\n' )
};
valid.push( test );


// EXPORTS //

module.exports = valid;
